import React from 'react';
import { VStack, Button, Heading, Box, Center } from "@chakra-ui/core";
import { styled } from "../theme";

const Wrapper = styled(Center)({
    width: "100vw",
    height: "100vh"
})
export const Homepage = () => {
    return (
        <Wrapper>
            <VStack spacing="10rem">
                <Heading as="h1" size="2xl">FYSP</Heading>
                <Button colorScheme="teal">Start</Button>
            </VStack>
        </Wrapper>
    )
}
